import React, { useState } from "react";
import "../styles.css";

function computeSettlement(people, expenses) {
  const totals = {};
  people.forEach((p) => (totals[p.name] = 0));

  expenses.forEach((exp) => {
    const share = exp.amount / exp.participants.length;
    exp.participants.forEach((part) => {
      totals[part] -= share;
    });
    totals[exp.payer] += exp.amount;
  });

  const creditors = [];
  const debtors = [];
  for (const name in totals) {
    const val = Math.round((totals[name] + 0.00001) * 100) / 100;
    if (val > 0) creditors.push({ name, amount: val });
    else if (val < 0) debtors.push({ name, amount: -val });
  }

  creditors.sort((a, b) => b.amount - a.amount);
  debtors.sort((a, b) => b.amount - a.amount);

  const settlements = [];
  let i = 0,
    j = 0;
  while (i < creditors.length && j < debtors.length) {
    const take = Math.min(creditors[i].amount, debtors[j].amount);
    settlements.push({
      from: debtors[j].name,
      to: creditors[i].name,
      amount: Math.round(take * 100) / 100,
    });
    creditors[i].amount -= take;
    debtors[j].amount -= take;
    if (creditors[i].amount < 0.01) i++;
    if (debtors[j].amount < 0.01) j++;
  }

  return { totals, settlements };
}

export default function Dashboard() {
  // ðŸ§­ Group Management
  const [groups, setGroups] = useState(["College Trip"]);
  const [activeGroup, setActiveGroup] = useState("College Trip");
  const [newGroup, setNewGroup] = useState("");
  const [groupData, setGroupData] = useState({
    "College Trip": {
      people: [
        { name: "Ayesha" },
        { name: "Daphne" },
        { name: "Mary" },
      ],
      expenses: [],
    },
  });

  const currentGroup = groupData[activeGroup];

  function addGroup() {
    if (!newGroup.trim() || groups.includes(newGroup.trim())) return;
    const updated = [...groups, newGroup.trim()];
    setGroups(updated);
    setGroupData({ ...groupData, [newGroup.trim()]: { people: [], expenses: [] } });
    setNewGroup("");
    setActiveGroup(newGroup.trim());
  }

  function switchGroup(name) {
    setActiveGroup(name);
  }

  // ðŸ§ People & Expenses
  const [personName, setPersonName] = useState("");
  const [title, setTitle] = useState("");
  const [amount, setAmount] = useState("");
  const [payer, setPayer] = useState("");
  const [selectedParts, setSelectedParts] = useState([]);

  const { totals, settlements } = computeSettlement(currentGroup.people, currentGroup.expenses);

  function addPerson() {
    if (!personName.trim()) return;
    if (currentGroup.people.find((p) => p.name === personName.trim())) return;
    const updated = {
      ...groupData,
      [activeGroup]: {
        ...currentGroup,
        people: [...currentGroup.people, { name: personName.trim() }],
      },
    };
    setGroupData(updated);
    setPersonName("");
  }

  function addExpense() {
    const amt = parseFloat(amount);
    if (!title || !amt || !payer || selectedParts.length === 0) return;
    const exp = { title, amount: amt, payer, participants: [...selectedParts] };
    const updated = {
      ...groupData,
      [activeGroup]: {
        ...currentGroup,
        expenses: [...currentGroup.expenses, exp],
      },
    };
    setGroupData(updated);
    setTitle("");
    setAmount("");
  }

  function toggleParticipant(name) {
    setSelectedParts((prev) =>
      prev.includes(name) ? prev.filter((p) => p !== name) : [...prev, name]
    );
  }

  return (
    <div className="main-layout">
      {/* Sidebar for Group Management */}
      <div className="sidebar">
        <h3>ðŸ§­ Groups</h3>
        <div className="group-input">
          <input
            className="input"
            placeholder="Add Group..."
            value={newGroup}
            onChange={(e) => setNewGroup(e.target.value)}
          />
          <button className="btn-primary" onClick={addGroup}>
            +
          </button>
        </div>

        <ul className="group-list">
          {groups.map((g) => (
            <li
              key={g}
              className={g === activeGroup ? "active" : ""}
              onClick={() => switchGroup(g)}
            >
              {g === activeGroup ? "âœ…" : "ðŸ”¹"} {g}
            </li>
          ))}
        </ul>
      </div>

      {/* Main Content */}
      <div className="app-grid">
        <div className="card-panel">
          <h5>People</h5>
          <div style={{ display: "flex", gap: 8 }}>
            <input
              className="input"
              placeholder="Name (e.g. Ayesha)"
              value={personName}
              onChange={(e) => setPersonName(e.target.value)}
            />
            <button className="btn-primary" onClick={addPerson}>
              + Add
            </button>
          </div>
          <div style={{ marginTop: 12 }}>
            {currentGroup.people.map((p) => (
              <div key={p.name}>{p.name}</div>
            ))}
          </div>
        </div>

        <div className="card-panel">
          <h5>Expenses</h5>
          <input
            className="input mb-2"
            placeholder="Title (e.g. Dinner)"
            value={title}
            onChange={(e) => setTitle(e.target.value)}
          />
          <div style={{ display: "flex", gap: 12, marginBottom: 10 }}>
            <select
              className="input"
              style={{ width: "60%" }}
              value={payer}
              onChange={(e) => setPayer(e.target.value)}
            >
              <option value="">Select payer</option>
              {currentGroup.people.map((p) => (
                <option key={p.name}>{p.name}</option>
              ))}
            </select>
            <input
              className="input"
              style={{ width: "40%" }}
              placeholder="Amount (â‚¹)"
              value={amount}
              onChange={(e) => setAmount(e.target.value)}
            />
          </div>

          <div>Participants:</div>
          <div style={{ display: "flex", gap: 8, flexWrap: "wrap" }}>
            {currentGroup.people.map((p) => (
              <label key={p.name}>
                <input
                  type="checkbox"
                  checked={selectedParts.includes(p.name)}
                  onChange={() => toggleParticipant(p.name)}
                />{" "}
                {p.name}
              </label>
            ))}
          </div>

          <div style={{ marginTop: 12 }}>
            <button className="btn-primary" onClick={addExpense}>
              + Add Expense
            </button>
          </div>

          <div style={{ marginTop: 12 }}>
            <h6>All expenses</h6>
            <ul>
              {currentGroup.expenses.map((ex, i) => (
                <li key={i}>
                  {ex.title} â€” â‚¹{ex.amount} â€” Paid by {ex.payer}
                </li>
              ))}
            </ul>
          </div>
        </div>

        <div className="card-panel">
          <h5>Results</h5>
          {Object.keys(totals).map((p) => (
            <div key={p}>
              {p}: â‚¹{totals[p].toFixed(2)}
            </div>
          ))}
          <h6>Settlement Plan</h6>
          {settlements.map((s, i) => (
            <div key={i}>
              {s.from} â†’ {s.to}: â‚¹{s.amount}
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}
